svg.script:
node_clicked = function(target) {
	if(target.correspondingUseElement)
            var target_cue = target.correspondingUseElement;	
	console.log("tree node clicked, this="+target+", cue="+target_cue+", window.parent = "+window.parent);
	respond_to_click(target);
	if (window.parent.tree_node_clicked)
            window.parent.tree_node_clicked(target);
	else
	    alert("You clicked '" + target.id + "' which is a " + target.nodeName + " element");
}

respond_to_click = function(target) {
	console.log("respond_to_click: "+target.id)
	target.classList.toggle('highlight');
	var turn_on = target.matches('.highlight');
	var affected_nodes = target.querySelectorAll('.tip_name, .subtree, .tip');
	for (const node of affected_nodes) {
	   // console.log("  id="+node.id+", is_hl:"+node.matches('.highlight'))
	   if (turn_on) 
		{node.classList.add('highlight');}
	   else 
		{node.classList.remove('highlight');}
	}
}
